  render() {
    const { count } = this.props.count;
    return (
      <div>

        <Row>
          <Col span={10}>
            <Slider
              min={1}
              max={50}
              onChange={this.props.sliderCountChange}
            />
          </Col>
        </Row>
        <Row>
        <Col span={3}>min</Col>
        <Col span={6}>
          <Slider
            min={1}
            max={50}
            onChange={this.props.sliderCountChange}
          />
        </Col>
        <Col span={3}>max</Col>
      </Row>
      </div>
    );
  }
}

export default IntegerStep
